    false,nt"url": null,nt"notes": "The results of seabird investigations on
    Middleton Island, Alaska, during the summer of 1976 are reported here. The purpose
    of this study was to gather baseline census, breeding phenology and food habit data
    on local seabird populations. This study was one of several initiated during 1976
    by the U.S. Fish and Wildlife Service to better assess the effect of future offshore
    gas and oil production and transportation on seabird populations along coastal Alaska.
    The report covers the period June 18 - August 2.",nt"license_title": "License
